description:
The Creeds have just moved to a new house in the countryside. Their house is perfect, except for two things: the semi-trailers that roar past on the narrow road, and the mysterious cemetary in the woods behind the house. The Creeds neighbours are reluctant to talk about the cemetary, and for good reason too.
